import './App.css';

function App() {
  return (
    <div className="App">
      <header>
      <h1>Sistema de Cadastro de Alunos</h1>
      </header>

      <div classname="form">
      <label>Disciplina</label>
      <input type="text" name="disciplina" />
      <label>Professor</label>
      <input type="text" name="professor" />
      </div>
    </div>
  );
}

export default App;
